import React, { Component } from 'react';
import './App.css';
import NavComponent from './components/NavComponent';

class App extends Component {
  constructor(props){
    super(props);
    this.logs = [];
  }

  render() {
    return (
      <div className="App">
        <NavComponent />
      </div>
    );
  }
}

export default App;
